query GetOutcomeInvitations($page: Int, $size: Int, $searchQuery: String) {
  user {
    id
    outcomeInvitations(page: $page, size: $size, searchQuery: $searchQuery) {
      edges {
        node {
          id
          outcomeInvitations(page: $page, size: $size, searchQuery: $searchQuery) {
            edges {
              node {
                id
                __typename
              }
              __typename
            }
            pageInfo {
              hasPreviousPage
              hasNextPage
              __typename
            }
            __typename
          }
          friendStatus
          __typename
        }
        __typename
      }
      pageInfo {
        hasPreviousPage
        hasNextPage
        __typename
      }
      __typename
    }
    __typename
  }
}
